import React,{ Component} from 'react';
import './../App.css';
import Header from './Header';
import Search from './Search';
import TableData from './TableData';
import AddUser from './AddUser';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      status : true,

    };
  }

  connectFromApp = () => { alert('connected from App!') }
  render() {
    return (
      <div>
          <Header/>
          <div className="SearchForm">
            <div className="container">
                <div className="row">
                    <Search connect = {() => this.connectFromApp()}/>
                    <TableData/>
                    <AddUser/>
                </div>
            </div>
          </div>
      </div>
    );
  }
}

export default App;
